
import base64
import vertexai
from vertexai.preview.generative_models import GenerativeModel, Part
import vertexai.preview.generative_models as generative_models
import config as config

def generate():
  vertexai.init(project=config.PROJECT_ID, location=config.LOCATION)
  model = GenerativeModel("gemini-1.0-pro-vision-001")
  responses = model.generate_content(
    ["""Based on the document below""", image1, image2, image3, image4, image5, """Describe what I am buying.
Answer in French."""],
    generation_config={
        "max_output_tokens": 2048,
        "temperature": 0.1,
        "top_p": 1,
        "top_k": 32
    },
    safety_settings={
          generative_models.HarmCategory.HARM_CATEGORY_HATE_SPEECH: generative_models.HarmBlockThreshold.BLOCK_NONE,
          generative_models.HarmCategory.HARM_CATEGORY_DANGEROUS_CONTENT: generative_models.HarmBlockThreshold.BLOCK_NONE,
          generative_models.HarmCategory.HARM_CATEGORY_SEXUALLY_EXPLICIT: generative_models.HarmBlockThreshold.BLOCK_NONE,
          generative_models.HarmCategory.HARM_CATEGORY_HARASSMENT: generative_models.HarmBlockThreshold.BLOCK_NONE,
    },
    stream=True,
  )
  
  answer = []
  for response in responses:
    print(response.text, end="")
    answer.append(response.text)
  
  return "".join(answer)


image1 = Part.from_data(data=base64.b64decode(""""""), mime_type="image/png")
image2 = Part.from_data(data=base64.b64decode(""""""), mime_type="image/png")
image3 = Part.from_data(data=base64.b64decode(""""""), mime_type="image/png")
image4 = Part.from_data(data=base64.b64decode(""""""), mime_type="image/png")
image5 = Part.from_data(data=base64.b64decode(""""""), mime_type="image/png")

result = generate()

print(80*"*")
print(result)

